/*View structure for view product_breakage_report */

/*!50001 DROP TABLE IF EXISTS `product_breakage_report` */;
/*!50001 DROP VIEW IF EXISTS `product_breakage_report` */;

/*!50001 CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `product_breakage_report` AS select `pr`.`id` AS `id`,`pr`.`name` AS `product_name`,`pr`.`product_category_id` AS `product_category_id`,`pr`.`store_id` AS `store_id`,coalesce(sum(`b`.`total_units`),0) AS `breakage_qty`,coalesce(sum(`b`.`total_amount`),0) AS `breakage_amount` from (`products` `pr` left join `breakages` `b` on((`pr`.`id` = `b`.`product_id`))) group by `pr`.`id` */;

/*View structure for view product_purchase_report */

/*!50001 DROP TABLE IF EXISTS `product_purchase_report` */;
/*!50001 DROP VIEW IF EXISTS `product_purchase_report` */;

/*!50001 CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `product_purchase_report` AS select `pr`.`id` AS `id`,`pr`.`name` AS `product_name`,`pr`.`product_category_id` AS `product_category_id`,`pr`.`store_id` AS `store_id`,coalesce(sum(`pu`.`total_units`),0) AS `purchase_qty`,coalesce(sum(`pu`.`total_amount`),0) AS `purchase_amount` from (`products` `pr` left join `purchases` `pu` on((`pr`.`id` = `pu`.`product_id`))) group by `pr`.`id` */;

/*View structure for view product_sale_report */

/*!50001 DROP TABLE IF EXISTS `product_sale_report` */;
/*!50001 DROP VIEW IF EXISTS `product_sale_report` */;

/*!50001 CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `product_sale_report` AS select `pr`.`id` AS `id`,`pr`.`name` AS `product_name`,`pr`.`product_category_id` AS `product_category_id`,`pr`.`store_id` AS `store_id`,coalesce(sum(`s`.`total_units`),0) AS `sale_qty`,coalesce(sum(`s`.`total_amount`),0) AS `sale_amount` from (`products` `pr` left join `sales` `s` on((`pr`.`id` = `s`.`product_id`))) group by `pr`.`id` */;

/*View structure for view product_stock_report */

/*!50001 DROP TABLE IF EXISTS `product_stock_report` */;
/*!50001 DROP VIEW IF EXISTS `product_stock_report` */;

/*!50001 CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `product_stock_report` AS select `p`.`id` AS `product_id`,`p`.`product_name` AS `product_name`,`c`.`id` AS `category_id`,`c`.`name` AS `category_name`,`p`.`store_id` AS `store_id`,coalesce(`p`.`purchase_qty`,0) AS `purchase_qty`,coalesce(`p`.`purchase_amount`,0) AS `purchase_amount`,coalesce(`s`.`sale_qty`,0) AS `sale_qty`,coalesce(`s`.`sale_amount`,0) AS `sale_amount`,coalesce(`b`.`breakage_qty`,0) AS `breakage_qty`,coalesce(`b`.`breakage_amount`,0) AS `breakage_amount`,((coalesce(`p`.`purchase_qty`,0) - coalesce(`s`.`sale_qty`,0)) - coalesce(`b`.`breakage_qty`,0)) AS `balance_qty`,(coalesce(`s`.`sale_amount`,0) - coalesce(`p`.`purchase_amount`,0)) AS `profit_amount` from (((`product_purchase_report` `p` left join `product_sale_report` `s` on((`s`.`id` = `p`.`id`))) left join `product_breakage_report` `b` on((`b`.`id` = `p`.`id`))) left join `product_categories` `c` on((`c`.`id` = `p`.`product_category_id`))) */;

